import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function Component1() {
  return (
    <p>I'm component 1</p>
  );
}

function Component2() {
  return (
    <p>I'm component 2</p>
  );
}

function App() {
  const [comp2Render, setComp2Render] = useState(2);

  return (
    <div className="App">
      <button onClick={() => setComp2Render(1)}>Render Component 1</button>
      <button onClick={() => setComp2Render(2)}>Render Component 2</button>

      {comp2Render === 1 && (
        <Component1 />
      )}
      {comp2Render === 2 && (
        <Component2 />
      )}
    </div>
  );
}

export default App;
